import React from 'react';
import './App.css';
import NavBar from './NavBar';
import { Router } from 'react-router-dom';
import Home from '/'

function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Route to="/" component={Home} />
      </Router>
    </div>
  );
}

export default App;
